DROP DATABASE IF EXISTS notarius;
CREATE DATABASE notarius;

DROP USER 'admin'@'localhost';
CREATE USER 'admin'@'localhost' IDENTIFIED BY '123';

GRANT ALL PRIVILEGES ON mysql.* TO 'admin'@'localhost' WITH GRANT OPTION;
GRANT ALL PRIVILEGES ON notarius.* TO 'admin'@'localhost' WITH GRANT OPTION;
GRANT RELOAD ON *.* TO 'admin'@'localhost';

USE notarius;


CREATE  TABLE presupuesto ( 
	id                   INT  NOT NULL   AUTO_INCREMENT  PRIMARY KEY,
	no_presupuesto       VARCHAR(15)  NOT NULL     ,
	proyectista          VARCHAR(100)  NOT NULL     ,
	proyecto             VARCHAR(200)  NOT NULL     ,
	gestor               VARCHAR(100)       ,
	enajentante          VARCHAR(100)       ,
	adquiriente          VARCHAR(100)  NOT NULL     ,
	valor_operacion      DECIMAL(10,2)  NOT NULL     ,
	monto_honorarios     DECIMAL(10,2)       ,
	monto_impuestos      DECIMAL(10,2)       ,
	fecha_honorarios     DATE       ,
	saldo                DECIMAL(10,2)       ,
	pago_de_comision     DATE       ,
	CONSTRAINT unq_presupuesto_no_presupuesto UNIQUE ( no_presupuesto ) 
 ) engine=InnoDB;

CREATE  TABLE usuario ( 
	id                   INT UNSIGNED NOT NULL   AUTO_INCREMENT  PRIMARY KEY,
	nombre_usuario       VARCHAR(100)       ,
	rol                  ENUM('admin','proyectista','tramites','juridico','presupuesto','armadores','otro')       
 ) engine=InnoDB;

CREATE  TABLE depositos_presupuesto ( 
	id                   INT UNSIGNED NOT NULL   AUTO_INCREMENT  PRIMARY KEY,
	no_presupuesto       VARCHAR(15)  NOT NULL     ,
	CONSTRAINT fk_desgloce_ppto_presupuesto_2 FOREIGN KEY ( no_presupuesto ) REFERENCES presupuesto( no_presupuesto ) ON DELETE NO ACTION ON UPDATE NO ACTION
 ) engine=InnoDB;

CREATE  TABLE desgloce_ppto_presupuesto ( 
	id                   INT UNSIGNED NOT NULL   AUTO_INCREMENT  PRIMARY KEY,
	no_presupuesto       VARCHAR(15)  NOT NULL     ,
	CONSTRAINT fk_desgloce_ppto_presupuesto_0 FOREIGN KEY ( no_presupuesto ) REFERENCES presupuesto( no_presupuesto ) ON DELETE NO ACTION ON UPDATE NO ACTION
 )engine=InnoDB;

CREATE  TABLE escritura ( 
	id                   INT  NOT NULL   AUTO_INCREMENT  PRIMARY KEY,
	no_escritura         INT UNSIGNED NOT NULL     ,
	bis                  BOOLEAN   DEFAULT 0    ,
	no_presupuesto       VARCHAR(15)       ,
	volumen              INT  NOT NULL     ,
	fecha_escritura      DATE  NOT NULL     ,
	no_expediente        INT  NOT NULL     ,
	sr                   BOOLEAN       ,
	clave_catastral      VARCHAR(100)  NOT NULL     ,
	infonavit            INT       ,
	entrega_testimonio   DATE       ,
	observaciones_escritura        VARCHAR(500)       ,
	fecha_vence_td       DATE       ,
	CONSTRAINT `unique` UNIQUE ( no_escritura, bis ) ,
	CONSTRAINT fk_escritura_presupuesto FOREIGN KEY ( no_presupuesto ) REFERENCES presupuesto( no_presupuesto ) ON DELETE NO ACTION ON UPDATE NO ACTION
 ) engine=InnoDB;

CREATE  TABLE facturas ( 
	id                   INT UNSIGNED NOT NULL   AUTO_INCREMENT  PRIMARY KEY,
	no_presupuesto       VARCHAR(15)  NOT NULL     ,
	escritura_id         INT       ,
	CONSTRAINT unq_facturas_no_presupuesto UNIQUE ( no_presupuesto ) ,
	CONSTRAINT fk_facturas_escritura FOREIGN KEY ( escritura_id ) REFERENCES escritura( id ) ON DELETE NO ACTION ON UPDATE NO ACTION,
	CONSTRAINT fk_facturas_presupuesto FOREIGN KEY ( no_presupuesto ) REFERENCES presupuesto( no_presupuesto ) ON DELETE NO ACTION ON UPDATE NO ACTION
 ) engine=InnoDB;

CREATE  TABLE juridico ( 
  id                   INT  NOT NULL   AUTO_INCREMENT  PRIMARY KEY,
	escritura_id         INT  NOT NULL ,
	contrato_en_extracto BOOLEAN       ,
	firmas_en_extracto   BOOLEAN       ,
	pendientes           BOOLEAN       ,
	no_paso              BOOLEAN       ,
	otorgamiento         DATE       ,
	firma                DATE       ,
	autorizacion         DATE       ,
	fecha_aviso_renap    DATE       ,
	fecha_envio_dircc    DATE       ,
	uif_poder_irrevocable DATE       ,
	fecha_aviso_reloat   DATE       ,
	fecha_aviso_dir_not_tpa DATE       ,
	folios               INT       ,
	numeracion_folios    VARCHAR(100)       ,
	folio_cancelado      INT       ,
	fecha_minuta         DATE       ,
	fecha_apendice       DATE       ,
	minuta               BOOLEAN       ,
	apendice             BOOLEAN       ,
	fecha_entrega_juridico DATE       ,
	fecha_aviso_portal   DATE       ,
	fecha_cierre_antilavado DATE       ,
	isr_enajenacion      BOOLEAN       ,
	isr_adquisicion      BOOLEAN       ,
	iva                  BOOLEAN       ,
	CONSTRAINT fk_juridico_escritura FOREIGN KEY ( escritura_id ) REFERENCES escritura( id ) ON DELETE NO ACTION ON UPDATE NO ACTION
 ) engine=InnoDB;

CREATE  TABLE no_facturas ( 
	id                   INT  NOT NULL   AUTO_INCREMENT  PRIMARY KEY,
	id_relacion          INT UNSIGNED NOT NULL     ,
	no_factura           INT  NOT NULL     ,
	CONSTRAINT fk_facturas_facturas_escritura FOREIGN KEY ( id_relacion ) REFERENCES facturas( id ) ON DELETE NO ACTION ON UPDATE NO ACTION
 )engine=InnoDB;

CREATE  TABLE pagos_presupuesto ( 
	id                   INT UNSIGNED NOT NULL   AUTO_INCREMENT  PRIMARY KEY,
	no_presupuesto       VARCHAR(15)  NOT NULL     ,
	CONSTRAINT fk_desgloce_ppto_presupuesto_1 FOREIGN KEY ( no_presupuesto ) REFERENCES presupuesto( no_presupuesto ) ON DELETE NO ACTION ON UPDATE NO ACTION
 )engine=InnoDB;

CREATE  TABLE rpp ( 
	id                   INT UNSIGNED NOT NULL   AUTO_INCREMENT  PRIMARY KEY,
	no_presupuesto       VARCHAR(15)  NOT NULL     ,
	escritura_id         INT       ,
	folio_rpp            INT       ,
	observaciones_rpp        VARCHAR(500)       ,
	registrada           ENUM('en tramite', 'si', 'rechazado', 'reingreso', 'saldo insuficiente')       ,
	CONSTRAINT unq_rpp_folio_rpp UNIQUE ( folio_rpp ) ,
	CONSTRAINT fk_rpp_presupuesto FOREIGN KEY ( no_presupuesto ) REFERENCES presupuesto( no_presupuesto ) ON DELETE NO ACTION ON UPDATE NO ACTION,
	CONSTRAINT fk_rpp_escritura FOREIGN KEY ( escritura_id ) REFERENCES escritura( id ) ON DELETE NO ACTION ON UPDATE NO ACTION
 ) engine=InnoDB;

CREATE  TABLE rpp_fechas_rpp ( 
	id                   INT UNSIGNED NOT NULL   AUTO_INCREMENT  PRIMARY KEY,
	id_rpp               INT UNSIGNED NOT NULL     ,
	CONSTRAINT fk_rpp_fechas_rpp_rpp FOREIGN KEY ( id_rpp ) REFERENCES rpp( id ) ON DELETE NO ACTION ON UPDATE NO ACTION
 )engine=InnoDB;

CREATE  TABLE aviso_definitivo ( 
  id                   INT  NOT NULL   AUTO_INCREMENT  PRIMARY KEY,
	folio_rpp            INT       ,
	fecha_presentado     DATE       ,
	fecha_salida         DATE       ,
	fecha_vence          DATE       ,
	CONSTRAINT fk_aviso_definitivo_rpp FOREIGN KEY ( folio_rpp ) REFERENCES rpp( folio_rpp ) ON DELETE NO ACTION ON UPDATE NO ACTION
 ) engine=InnoDB;

CREATE  TABLE depositos ( 
	id                   INT  NOT NULL   AUTO_INCREMENT  PRIMARY KEY,
	id_relacion          INT UNSIGNED NOT NULL     ,
	fecha                DATE  NOT NULL     ,
	concepto             VARCHAR(100)  NOT NULL     ,
	cantidad             DECIMAL(10,2)  NOT NULL     ,
	observaciones        VARCHAR(500)       ,
	banco                VARCHAR(100)       ,
	tipo                 ENUM('honorario','impuestos')       ,
	CONSTRAINT fk_depositos_pagos_presupuesto FOREIGN KEY ( id_relacion ) REFERENCES pagos_presupuesto( id ) ON DELETE NO ACTION ON UPDATE NO ACTION
 ) engine=InnoDB;

CREATE  TABLE pagos ( 
	id                   INT UNSIGNED NOT NULL   AUTO_INCREMENT  PRIMARY KEY,
	id_relacion          INT UNSIGNED NOT NULL     ,
	fecha                DATE  NOT NULL     ,
	concepto             VARCHAR(100)  NOT NULL     ,
	cantidad             DECIMAL(10,2)  NOT NULL     ,
	autorizado_por       VARCHAR(100)       ,
	observaciones        VARCHAR(500)       ,
	CONSTRAINT fk_pagos_depositos_presupuesto FOREIGN KEY ( id_relacion ) REFERENCES depositos_presupuesto( id ) ON DELETE NO ACTION ON UPDATE NO ACTION
 ) engine=InnoDB;

CREATE  TABLE catastro_calificacion ( 
	id                   INT UNSIGNED NOT NULL   AUTO_INCREMENT  PRIMARY KEY,
	vencimiento_td       BOOLEAN       ,
	no_presupuesto       VARCHAR(15)  NOT NULL     ,
	escritura_id         INT       ,
	observaciones_cat_calif        VARCHAR(500)       ,
	cat_rev              ENUM('si','en tramite', 'correccion')       ,
	CONSTRAINT fk_catastro_calificacion FOREIGN KEY ( escritura_id ) REFERENCES escritura( id ) ON DELETE NO ACTION ON UPDATE NO ACTION,
	CONSTRAINT fk_catastro_calificacion_presupuesto FOREIGN KEY ( no_presupuesto ) REFERENCES presupuesto( no_presupuesto ) ON DELETE NO ACTION ON UPDATE NO ACTION
 ) engine=InnoDB;

CREATE  TABLE catastro_td ( 
	id                   INT UNSIGNED NOT NULL   AUTO_INCREMENT  PRIMARY KEY,
	escritura_id         INT  NOT NULL     ,
	observaciones_cat_td        VARCHAR(500)       ,
	cat_terminado        ENUM('si','en tramite','correccion')       ,
	CONSTRAINT fk_catastro_td_escritura FOREIGN KEY ( escritura_id ) REFERENCES escritura( id ) ON DELETE NO ACTION ON UPDATE NO ACTION
 ) engine=InnoDB;

CREATE  TABLE cc_fechas_cc ( 
	id                   INT UNSIGNED NOT NULL   AUTO_INCREMENT  PRIMARY KEY,
	id_cc                INT UNSIGNED NOT NULL     ,
	CONSTRAINT fk_cc_fechas_cc_catastro_calificacion FOREIGN KEY ( id_cc ) REFERENCES catastro_calificacion( id ) ON DELETE NO ACTION ON UPDATE NO ACTION
 )engine=InnoDB;

CREATE  TABLE ctd_fechas_ctd ( 
	id                   INT UNSIGNED NOT NULL   AUTO_INCREMENT  PRIMARY KEY,
	id_ctd               INT UNSIGNED NOT NULL     ,
	CONSTRAINT fk_ctd_fechas_ctd_catastro_td FOREIGN KEY ( id_ctd ) REFERENCES catastro_td( id ) ON DELETE NO ACTION ON UPDATE NO ACTION
 )engine=InnoDB;

CREATE  TABLE desgloce_ppto ( 
	id                   INT  NOT NULL   AUTO_INCREMENT  PRIMARY KEY,
	id_relacion          INT UNSIGNED NOT NULL     ,
	concepto             VARCHAR(100)  NOT NULL     ,
	cantidad             DECIMAL(10,2)  NOT NULL     ,
	CONSTRAINT fk_desgloce_ppto_relacion_desgloce_presupuesto FOREIGN KEY ( id_relacion ) REFERENCES desgloce_ppto_presupuesto( id ) ON DELETE NO ACTION ON UPDATE NO ACTION
 ) engine=InnoDB;

CREATE  TABLE direccion_notarias_seguimiento_juicios ( 
  id                   INT  NOT NULL   AUTO_INCREMENT  PRIMARY KEY,
	escritura_id         INT  NOT NULL ,
	no_oficio_escritura  INT       ,
	fecha_envio_escritura DATE       ,
	fecha_solicitud_busqueda_testa_dircc DATE       ,
	fecha_solicitud_busqueda_testa_rpp DATE       ,
	fecha_publicacion_boletin DATE       ,
	fecha_publicacion_periodico DATE       ,
	CONSTRAINT fk_direccion_notarias_seguimiento_juicios FOREIGN KEY ( escritura_id ) REFERENCES escritura( id ) ON DELETE NO ACTION ON UPDATE NO ACTION
 ) engine=InnoDB;

CREATE  TABLE fechas_catastro_calif ( 
	id                   INT  NOT NULL   AUTO_INCREMENT  PRIMARY KEY,
	id_fechas            INT UNSIGNED NOT NULL     ,
	cat_envio_calif      DATE       ,
	cat_regreso_calif    DATE       ,
	observaciones        VARCHAR(500)       ,
	CONSTRAINT fk_fechas_catastro_calif_cc_fechas_cc FOREIGN KEY ( id_fechas ) REFERENCES cc_fechas_cc( id ) ON DELETE NO ACTION ON UPDATE NO ACTION
 ) engine=InnoDB;

CREATE  TABLE fechas_catastro_td ( 
	id                   INT  NOT NULL   AUTO_INCREMENT  PRIMARY KEY,
	id_fechas            INT UNSIGNED NOT NULL     ,
	cat_envio_td         DATE       ,
	cat_regreso_td       DATE       ,
	observaciones        VARCHAR(500)       ,
	CONSTRAINT fk_fechas_catastro_td_ctd_fechas_ctd FOREIGN KEY ( id_fechas ) REFERENCES ctd_fechas_ctd( id ) ON DELETE NO ACTION ON UPDATE NO ACTION
 )engine=InnoDB;

CREATE  TABLE fechas_rpp ( 
	id                   INT  NOT NULL   AUTO_INCREMENT  PRIMARY KEY,
	id_fechas            INT UNSIGNED NOT NULL     ,
	envio_rpp            DATE       ,
	regreso_rpp          DATE       ,
	observaciones        VARCHAR(500)       ,
	CONSTRAINT fk_fechas_rpp_rpp_fechas_rpp FOREIGN KEY ( id_fechas ) REFERENCES rpp_fechas_rpp( id ) ON DELETE NO ACTION ON UPDATE NO ACTION
 )engine=InnoDB;


 

