create or replace view vista_tabla as
(select P.no_presupuesto,P.proyectista,P.proyecto,P.gestor,P.adquiriente,P.enajentante,P.valor_operacion,P.fecha_honorarios,P.monto_honorarios,P.monto_impuestos,P.saldo,P.pago_de_comision,E.no_escritura,E.bis,E.volumen,E.fecha_escritura,E.no_expediente,E.sr,E.clave_catastral,E.infonavit,E.entrega_testimonio,E.observaciones_escritura,E.fecha_vence_td,F.id as facturas,J.firma,J.isr_enajenacion,J.fecha_aviso_renap,J.iva,J.uif_poder_irrevocable,J.fecha_aviso_dir_not_tpa,J.numeracion_folios,J.fecha_minuta,J.contrato_en_extracto,J.minuta,J.pendientes,J.fecha_entrega_juridico,J.otorgamiento,J.fecha_cierre_antilavado,J.autorizacion,J.isr_adquisicion,J.fecha_envio_dircc,J.fecha_aviso_reloat,J.folios,J.folio_cancelado,J.fecha_apendice,J.firmas_en_extracto,J.apendice,J.no_paso,J.fecha_aviso_portal,D.no_oficio_escritura,D.fecha_envio_escritura,D.fecha_solicitud_busqueda_testa_rpp,D.fecha_solicitud_busqueda_testa_dircc,D.fecha_publicacion_periodico,D.fecha_publicacion_boletin,CC.id as id_cat_cc,CC.vencimiento_td,CC.observaciones_cat_calif,CC.cat_rev,FCC.id as fechas_catastro_calif,CT.id as id_cat_td,CT.cat_terminado,CT.observaciones_cat_td,FCT.id as fechas_catastro_td,R.id as id_rpp,R.folio_rpp,R.observaciones_rpp,R.registrada,FR.id as fechas_rpp,A.fecha_presentado,A.fecha_salida,A.fecha_vence,F.id as desgloce_ppto, BP.id as pagos, BD.id as depositos
from presupuesto P
left join escritura E on E.no_presupuesto = P.no_presupuesto
left join facturas F on F.no_presupuesto = P.no_presupuesto
left join juridico J on J.escritura_id = E.id
left join direccion_notarias_seguimiento_juicios D on D.escritura_id = E.id
left join catastro_calificacion CC on CC.no_presupuesto = P.no_presupuesto
left join cc_fechas_cc FCC on FCC.id_cc = CC.id
left join catastro_td CT on CT.escritura_id = E.id
left join ctd_fechas_ctd FCT on FCT.id_ctd = CT.id
left join rpp R on R.no_presupuesto = P.no_presupuesto
left join rpp_fechas_rpp FR on FR.id_rpp = R.id
left join aviso_definitivo A on A.folio_rpp = R.folio_rpp 
left join depositos_presupuesto BD on BD.no_presupuesto = P.no_presupuesto
left join pagos_presupuesto BP on BP.no_presupuesto = P.no_presupuesto
left join desgloce_ppto_presupuesto DP on DP.no_presupuesto = P.no_presupuesto
group by P.id)
union all
(select null,null,null,null,null,null,null,null,null,null,null,null,E.no_escritura,E.bis,E.volumen,E.fecha_escritura,E.no_expediente,E.sr,E.clave_catastral,E.infonavit,E.entrega_testimonio,E.observaciones_escritura,E.fecha_vence_td,null,J.firma,J.isr_enajenacion,J.fecha_aviso_renap,J.iva,J.uif_poder_irrevocable,J.fecha_aviso_dir_not_tpa,J.numeracion_folios,J.fecha_minuta,J.contrato_en_extracto,J.minuta,J.pendientes,J.fecha_entrega_juridico,J.otorgamiento,J.fecha_cierre_antilavado,J.autorizacion,J.isr_adquisicion,J.fecha_envio_dircc,J.fecha_aviso_reloat,J.folios,J.folio_cancelado,J.fecha_apendice,J.firmas_en_extracto,J.apendice,J.no_paso,J.fecha_aviso_portal,D.no_oficio_escritura,D.fecha_envio_escritura,D.fecha_solicitud_busqueda_testa_rpp,D.fecha_solicitud_busqueda_testa_dircc,D.fecha_publicacion_periodico,D.fecha_publicacion_boletin,null,null,null,null,null,CT.id as id_cat_td,CT.cat_terminado,CT.observaciones_cat_td,FCT.id as fechas_catastro_td,null,null, null,null,null,null,null,null,null,null,null
from presupuesto P
left join escritura E on E.no_presupuesto IS NULL or E.no_presupuesto = ''
left join juridico J on J.escritura_id = E.id
left join direccion_notarias_seguimiento_juicios D on D.escritura_id = E.id
left join catastro_td CT on CT.escritura_id = E.id
left join ctd_fechas_ctd FCT on FCT.id_ctd = CT.id
group by E.id
)order by no_escritura asc;

CREATE TABLE tabla_final AS       SELECT    *  FROM vista_tabla;
ALTER TABLE tabla_final ENGINE = InnoDB;
alter table tabla_final add column id int unsigned not null auto_increment primary key first;
drop view vista_tabla;

alter table tabla_final modify column no_escritura int unsigned null after no_presupuesto;
alter table tabla_final modify column bis tinyint(1) null after no_escritura;

alter table tabla_final modify column facturas int unsigned null;
alter table tabla_final modify column desgloce_ppto int unsigned null;
alter table tabla_final modify column depositos int unsigned null;
alter table tabla_final modify column pagos int unsigned null;
alter table tabla_final modify column fechas_catastro_calif int unsigned null;
alter table tabla_final modify column fechas_rpp int unsigned null;

alter table tabla_final add constraint fk_facturas foreign key (facturas) references facturas(id);
alter table tabla_final add constraint fk_desgloce_ppto foreign key (desgloce_ppto) references desgloce_ppto_presupuesto(id);
alter table tabla_final add constraint fk_depositos foreign key (depositos) references depositos_presupuesto(id);
